        "description": "Five years ago today, we introduced the GoPro Community to GoPro Awards ‚Äì an always-on program created to reward camera users with monetary awards and gear for sharing their best GoPro content.\n\nTo celebrate, we pulled together a video tribute highlighting our Top 10 GoPro Awards moments‚Äîfrom glacier water skiing and a cliff wall rope swing to tug-at-your-heartstrings moments like the resurrection of a kitten and an in-flight proposal‚Äîlet's just say we've received a lot of variety these past few years. \n\nCheck it out and let us know if your favorite - or even your own clip made the cut.\n\nTo submit to awards visit: https://gopro.com/en/us/awards\n\nRead more about our five year anniversary on The Inside Line:\nhttps://gopro.com/en/us/news/gopro-awards-five-year-anniversary\n\nShot 100% on GoPro: https://bit.ly/37cQTWO\nGet stoked and subscribe: http://goo.gl/HgVXpQ\n\n00:00 Intro\n00:21 #10 - Rapelling Down El Capitan\n01:00 #9 - Double Backflip in Jackson Hole Backcountry\n01:29 #8 - Longboard Freestyle with FPV Drone\n02:19 #7 - Glacier Water Ski\n02:40 #6 - Rubik's Cube Challenge\n03:17 #5 - Skier Falls Into Crevasse\n04:10 #4 - Frozen Kitten Lives\n04:47 #3 - Airplane Failure Marriage Proposal \n06:02 #2 - Turkish Ice Cream Tricks\n06:46 #1 - On a Rocket Launch to Space\n\n\nFor more from GoPro, follow us:\nFacebook: https://www.facebook.com/gopro\nTwitter: https://twitter.com/gopro\nInstagram: https://instagram.com/gopro\nTumblr: http://gopro.tumblr.com/\nPinterest: http://www.pinterest.com/gopro   \nInside Line: https://gopro.com/news\nGoPro: https://gopro.com/channel/\n#GoPro",
